css:
.tree-view-scroller {
  transition: -webkit-transform 0.3s, height 0.3s;
}
.with-breadcrumb .tree-view-scroller {
  -webkit-transform: translate(0, 27px);
  height: calc(100% - @{@breadcrumb-height});
}
.tree-view-breadcrumb.tool-panel {
  position: absolute;
  left: 0;
  right: 0;
  overflow-x: auto;
  transition: -webkit-transform 0.3s;
  -webkit-transform: translate(0, -27px);
}
.tree-view-breadcrumb.tool-panel.visible {
  -webkit-transform: translate(0, 0);
}
.tree-view-breadcrumb.tool-panel .btn-group {
  white-space: nowrap;
}
.tree-view-breadcrumb.tool-panel .btn-group .btn {
  float: none;
}
